function App() {
  return (
    <div className="App">
      <form method="post" action="http://localhost:4000/search">
          <label for="zipcode">Zipcode</label>
          <input id="zipcode"/>
          <button type="submit">Submit</button>
      </form>
    </div>
  );
 }
 export default App;
